import React from 'react';
import styled from 'styled-components';
import Card from '../components/Card';

const HomeContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  padding: 2rem;
`;

const Home = () => {
  const handleCardClick = (toolName) => {
    alert(`Navigating to ${toolName}...`);
    // Add navigation or further interaction here
  };

  return (
    <HomeContainer>
      <Card title="DSA Score Checker" onClick={() => handleCardClick('DSA Score Checker')} />
      <Card title="Resume Score Checker" onClick={() => handleCardClick('Resume Score Checker')} />
      <Card title="Placement Luck Predictor" onClick={() => handleCardClick('Placement Luck Predictor')} />
      <Card title="Website Score Prediction" onClick={() => handleCardClick('Website Score Prediction')} />
      <Card title="Competitive Programming Score" onClick={() => handleCardClick('Competitive Programming Score')} />
      <Card title="Package Prediction" onClick={() => handleCardClick('Package Prediction')} />
      <Card title="AI Chatbot" onClick={() => handleCardClick('AI Chatbot')} />
      <Card title="Code Plagiarism Detector" onClick={() => handleCardClick('Code Plagiarism Detector')} />
    </HomeContainer>
  );
};

export default Home;
